import React from "react";
import $ from "jquery";
import Slider from "./Slider";
import { elementData } from "./JSONRetriever";
import { computePhaseState } from "./ChemCalc";


class TemperatureSlider extends Slider {
    constructor(props) {
        super(props);
    }

    componentDidMount() {
        $("#temperatureSlider").val(293.15);
        this._updateAtomicElementStatesFromSlider(this.props.json);
    }

    

    render() {
        return (
            <div id="temperatureDiv">
                <span className="sliderSpan">
                    <input id="temperatureSlider" className="slider floatLeft" type="range" min="0" max="6000" step="0.01"
                           onChange={(event) => this.updateAtomicElementStatesFromSlider()} />
                </span>
                    
                <span>
                    <input id="temperatureInput" className="sliderTextbox centered floatRight" type="text" minLength="1" maxLength="6"
                           onKeyUp={(event) => this.updateAtomicElementStatesFromTextBox()} />
                </span>
            </div>
        );        
    }
}


export default TemperatureSlider
